import {BrowserRouter as Router, Route, Link, Routes} from 'react-router-dom';
import './App.css';
import Page1 from "./components/page1/page1" 

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={Page1}></Route>
      </Routes>
    </Router>
  );
}

export default App;
